import React, { Component } from "react";
import { connect } from "react-redux";
import { push } from "connected-react-router";
import ListItem from "@material-ui/core/ListItem";
import List from "@material-ui/core/ListItem";
import Button from "@material-ui/core/ListItem";
import styled from "styled-components";
import { fetchTrips } from "../../actions/trips";


const ListWrapper = styled.form`
  width: 100%;
  height: 100vh;
  gap: 10px;
  place-content: center;
  justify-items: center;
  display: grid;
`;

class ListTripsPage extends Component {
  constructor(props) {
    super(props);

  }

  // componentDidMount() {
  //   this.props.fetchTrips();
  // }


  render() {

    return (
      <ListWrapper>
        <Button onclick={this.props.fetchTrips}>Viagens marcadas</Button>
        {/* {this.props.trips.map(trip => (
          <List>
            <ListItem>{this.props.trip.name}</ListItem>
          </List>
        ))} */}
      </ListWrapper>
    );
  }
}

function mapStateToProps(state) {
  return {
    trips: state.trips.trips
 };

}
function mapDispatchToProps(dispatch) {
  return {
    fetchTrips: () => dispatch(fetchTrips())
  };

}
export default connect(
  mapStateToProps,
  mapDispatchToProps
)(ListTripsPage);
